import React from 'react'

export const KeyRend = () => {
    let fruits=["apple","pineapple","mango","watermelon"]
  return (
    <>
        {
            fruits.map((fruit)=>{
                return <h1>{fruits}</h1>
            })
        }
    </>
  )
}
